/*Table structure for table `resourcegrouppermission` */

DROP TABLE IF EXISTS `resourcegrouppermission`;

CREATE TABLE `resourcegrouppermission` (
  `groupid` int(11) NOT NULL,
  `type` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `addPermission` enum('10','20','30') COLLATE utf8_bin DEFAULT NULL,
  `deletePermission` enum('10','20','30') COLLATE utf8_bin DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `resourcegrouppermission` */

/*Table structure for table `reviewdata` */

DROP TABLE IF EXISTS `reviewdata`;

CREATE TABLE `reviewdata` (
  `id` int(11) NOT NULL,
  `idx` int(11) NOT NULL,
  `grade` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `max` double DEFAULT NULL,
  `score_min` double DEFAULT NULL,
  `score_max` double DEFAULT NULL,
  `score_mean` double DEFAULT NULL,
  PRIMARY KEY (`id`,`idx`,`grade`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `reviewdata` */

/*Table structure for table `reviewdetails` */

DROP TABLE IF EXISTS `reviewdetails`;

CREATE TABLE `reviewdetails` (
  `id` int(11) NOT NULL,
  `from` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `to` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `idx` int(11) DEFAULT NULL,
  `ranking` int(11) DEFAULT NULL,
  `points` double DEFAULT NULL,
  `strength` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `improvements` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_review` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`,`from`,`to`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `reviewdetails` */

/*Table structure for table `reviewmaster` */

DROP TABLE IF EXISTS `reviewmaster`;

CREATE TABLE `reviewmaster` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `groupID` int(11) DEFAULT NULL,
  `userid` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `reviewName` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `ranking` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `reviewType` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `datestart` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `dateend` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `datecreated` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `reviewmaster` */

/*Table structure for table `role` */

DROP TABLE IF EXISTS `role`;

CREATE TABLE `role` (
  `groupname` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `userid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `role` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `owner` int(1) DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

