/*Table structure for table `serveraccounts` */

DROP TABLE IF EXISTS `serveraccounts`;

CREATE TABLE `serveraccounts` (
  `accountid` bigint(20) NOT NULL AUTO_INCREMENT,
  `accounttype` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `accounthost` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `accountuser` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `accountpass` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`accountid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `serveraccounts` */

