/*Table structure for table `socialaccounts` */

DROP TABLE IF EXISTS `socialaccounts`;

CREATE TABLE `socialaccounts` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `userid` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `accounttype` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `socialid` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `autologin` tinyint(1) DEFAULT NULL,
  `accesstoken` text COLLATE utf8_unicode_ci,
  `accesstokensecret` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `socialaccounts` */

/*Table structure for table `twitteruser` */

DROP TABLE IF EXISTS `twitteruser`;

CREATE TABLE `twitteruser` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `PulseUserID` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `UserID` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `Password` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `Role` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Email` text COLLATE utf8_unicode_ci,
  `AutoSignIn` tinyint(1) DEFAULT NULL,
  `HasAccount` tinyint(1) DEFAULT NULL,
  `AccessToken` text COLLATE utf8_unicode_ci,
  `AccessTokenSecret` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

