  `role` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fullname` text COLLATE utf8_unicode_ci,
  `email` text COLLATE utf8_unicode_ci,
  `ntlogin` varchar(50) COLLATE utf8_unicode_ci DEFAULT '',
  `status` text COLLATE utf8_unicode_ci,
  `handphone` varchar(10) COLLATE utf8_unicode_ci DEFAULT '',
  `phone` varchar(10) COLLATE utf8_unicode_ci DEFAULT '',
  `aboutme` text COLLATE utf8_unicode_ci,
  `dob` varchar(20) COLLATE utf8_unicode_ci DEFAULT '',
  `gender` varchar(10) COLLATE utf8_unicode_ci DEFAULT '',
  `website` varchar(50) COLLATE utf8_unicode_ci DEFAULT '',
  `businessphone` varchar(10) COLLATE utf8_unicode_ci DEFAULT '',
  `address` text COLLATE utf8_unicode_ci,
  `appointment` text COLLATE utf8_unicode_ci,
  `unit` varchar(50) COLLATE utf8_unicode_ci DEFAULT '',
  `ticket` varchar(50) COLLATE utf8_unicode_ci DEFAULT '',
  `quota` bigint(20) DEFAULT NULL,
  `quotaused` bigint(20) DEFAULT NULL,
  `createdtime` datetime DEFAULT NULL,
  `isadmin` int(11) DEFAULT '0',
  PRIMARY KEY (`userid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

