/*Table structure for table `userprojects` */

DROP TABLE IF EXISTS `userprojects`;

CREATE TABLE `userprojects` (
  `projectid` int(10) DEFAULT NULL,
  `projectname` varchar(135) COLLATE utf8_bin DEFAULT NULL,
  `templatename` varchar(135) COLLATE utf8_bin DEFAULT NULL,
  `userid` varchar(135) COLLATE utf8_bin DEFAULT NULL,
  `pathsaved` varchar(135) COLLATE utf8_bin DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `userprojects` */

/*Table structure for table `workbin` */

DROP TABLE IF EXISTS `workbin`;

CREATE TABLE `workbin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `groupid` int(11) NOT NULL DEFAULT '0',
  `instructor` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `starttime` datetime DEFAULT NULL,
  `endtime` datetime DEFAULT NULL,
  `status` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `workbin` */

/*Table structure for table `workbinattachment` */

DROP TABLE IF EXISTS `workbinattachment`;

CREATE TABLE `workbinattachment` (
  `id` int(11) NOT NULL DEFAULT '0',
  `userid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fileid` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `filename` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `modifydate` datetime DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

